import React, { Component } from 'react'
import TabPopup from '../Tab/TabPopup'
import Nodes from '../Nodes/Nodes'
import './ClassificationTree.css'
import NodesActions from '../Nodes/NodesActions/NodesActions'

import { Data } from '../Nodes/DefaultProps'

class ClassificationTree extends Component {
    constructor(props) {
        super(props)
        this.state = {
            data: Data,
        }
    }
    render() {
        const tabs = [
            {
                title: 'Nodes',
                element: <Nodes />,
            },
            {
                title: 'Tree',
                element: <></>,
            },
        ]
        return (
            <div className="container">
                <TabPopup
                    tabs={tabs}
                    actions={<NodesActions data={this.state.data} />}
                />
            </div>
        )
    }
}

export default ClassificationTree
